import logo from './logo.svg';
import './App.css';
import {BrowserRouter,Route, Routes} from 'react-router-dom'
import Home from './Pages/Home';
function App() {
  return (
    <div className="App my-0">
      <BrowserRouter>
      <Routes>
      <Route path='/' element={<Home/>}/>
      </Routes>
      </BrowserRouter>

    </div>
  );
}

export default App;
